import React from "react";

const CoffeeCard = ({ coffee }) => {
  return (
    <div className="card">
      <img src={coffee.image} alt={coffee.name} />
      <h3>{coffee.name}</h3>
      <p>{coffee.description}</p>
      <p>Prix : {coffee.price} MAD</p>
    </div>
  );
};

export default CoffeeCard;
